ReggaeWarehouse + DUBPLATE D.T Culture Cuts 2      

This cd has roots and culture selection, there are some dubplate specials but mostly plastic tunes. 
Most tunes on this cd are deep, from Earl 16 to BARRY BROWN, Sluggy Ranks to Rod Talor. 

If you love roots and culture and dub!!!!!! this is the cd for you. 

